import React, { Component } from 'react'
import './App.css';
import BookList from './BookList';
console.log(BookList);
const book = {
    color
}

export default class App extends Component {
    
    render() {
        return (
            <ul>
          {BookList.map((item,index) => {
              <li key={index} style={book}>
                  <h2>{item.title}</h2>
                  <h3><i>{item.author}</i></h3>
              </li>
          })}
            </ul>
        )
    }
}
